import React,{useState} from 'react';
const App=()=>{
    const [myObject,setMyobject]=useState({
        myname:"Khanam",age:10
    });
    const changeObject=()=>{
        setMyobject({
            myname:"khaiser",age:10
        });
    }
    return(
        <>
<h1>{myObject.myname}</h1>
<h1>{myObject.age}</h1>
<button onClick={changeObject}>Change</button>
        </>
    )
}
export default App;
